import { Component } from '@angular/core';

@Component({
  selector: 'app-header',
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.scss']
})
export class HeaderComponent {

}
<html>

  <img class="logo" src="../../../assets/logo.png" height=25/>

  <div class="search-bar">
    <form action="/rechercher" method="get">

      <input type="text" id="loc" name="terme" placeholder="N'importe où" required>
      <input type="text" id="date" name="terme" placeholder="Une semaine" required>
      <input type="text" id="who" name="terme" placeholder="Ajoutez des voyageurs" required>

    </form>
  </div>

  <h5 class="text">Mettre mon logement sur Airbnb</h5>
</html>
